import React from 'react'

const Item = (props) => {
  return (
    <div className='item'>
        <img src={`../Data/Images/${props.image.replace(/['"]/g, '')}`} alt={props.category}/>

        <p>{props.category}</p>
        <div className='item-prices'>
            <div className='item-price-new'>
                {props.TYPE}
            </div>
        </div>

    </div>
  )
}

export default Item
